const ShowSearchedMovies = props => {
    if(props.results){
    props.results.forEach(element => {
        console.log(element.id)
        console.log(element.title)
        console.log(element.description)
        console.log(element.image)
    });
}
    return (
        <div>
            <p style={{color:"white"}}>heyyyyyyyyyyyyyyyy</p>
            {props.results.map((movie) => (
                <MoviesListDisplay
                    id={movie.id}
                    title={movie.title}
                    id={movie.id}
                    category={movie.category}
                    rating={movie.rating}
                    image={movie.image}
                    theater={movie.theater}
                    timing={movie.timing}
                    capacity={movie.capacity}
                    price={movie.price}
                    nowShowing={movie.nowShowing}
                    onUpdateCartCapacity={props.onUpdateCartCapacity}
                />
            ))}
        </div>
    );
};

export default ShowSearchedMovies;
